import React from "react";
import { View, Text } from "react-native";
import MainTabNavigator from "../ProfileTabNavigator/MainTabNavigator";

function HomeScreen() {
  return (
    <View>
      <Text>HomeScreen</Text>
      <MainTabNavigator />
    </View>
  );
}

export default HomeScreen;
